import React from "react";
import Pins from "../../data/map.json";

const Landmark = ({ map }) => {
  map.on("load", () => {
    map.addSource("places", Pins);
  });

  map.addLayer({
    id: "places",
    type: "symbol",
    source: "places",
    layout: {
      "icon-image": "{icon}",
      "icon-allow-overlap": true,
    },
  });

  return <div></div>;
};

export default Landmark;
